(window.webpackJsonp=window.webpackJsonp||[]).push([[538],{595:function(s){s.exports={code:['<pre class="hljs"><code><span class="hljs-comment">/**\n * @param {string} ring\n * @param {string} key\n * @return {number}\n */</span>\n<span class="hljs-keyword">var</span> findRotateSteps = <span class="hljs-function"><span class="hljs-keyword">function</span>(<span class="hljs-params">ring, key</span>) </span>{\n  <span class="hljs-keyword">let</span> N=ring.length,M=key.length\n  <span class="hljs-keyword">let</span> dp=[]\n  <span class="hljs-keyword">for</span>(<span class="hljs-keyword">let</span> i=<span class="hljs-number">0</span>;i&lt;M+<span class="hljs-number">1</span>;i++){\n    dp[i]=[]\n    <span class="hljs-keyword">for</span>(<span class="hljs-keyword">let</span> j=<span class="hljs-number">0</span>;j&lt;N;j++){\n      dp[i][j]=<span class="hljs-literal">Infinity</span>\n    }\n  }\n  dp[<span class="hljs-number">0</span>][<span class="hljs-number">0</span>]=<span class="hljs-number">0</span>\n  <span class="hljs-keyword">for</span>(<span class="hljs-keyword">let</span> i=<span class="hljs-number">1</span>;i&lt;M+<span class="hljs-number">1</span>;i++){\n    <span class="hljs-keyword">for</span>(<span class="hljs-keyword">let</span> j=<span class="hljs-number">0</span>;j&lt;N;j++){\n      <span class="hljs-keyword">if</span>(ring[j]===key[i<span class="hljs-number">-1</span>]){\n        <span class="hljs-keyword">for</span>(<span class="hljs-keyword">let</span> k=<span class="hljs-number">0</span>;k&lt;N;k++){\n          <span class="hljs-keyword">if</span>(dp[i<span class="hljs-number">-1</span>][k]!==<span class="hljs-literal">Infinity</span>){\n            <span class="hljs-keyword">let</span> abs=<span class="hljs-built_in">Math</span>.abs(k-j)\n            dp[i][j]=<span class="hljs-built_in">Math</span>.min(dp[i][j],dp[i<span class="hljs-number">-1</span>][k]+<span class="hljs-built_in">Math</span>.min(abs,N-abs)+<span class="hljs-number">1</span>)\n          }\n        }        \n      }\n    }\n  }\n  \n  <span class="hljs-keyword">let</span> min=<span class="hljs-literal">Infinity</span>\n  <span class="hljs-keyword">for</span>(<span class="hljs-keyword">let</span> i=<span class="hljs-number">0</span>;i&lt;dp[M].length;i++){\n    min=<span class="hljs-built_in">Math</span>.min(min,dp[M][i])\n  }\n  <span class="hljs-keyword">return</span> min\n}; \n</code></pre>\n'],titleSlug:"freedom-trail",hasThinking:!1,content:'<p>\u89c6\u9891\u6e38\u620f&ldquo;\u8f90\u5c044&rdquo;\u4e2d\uff0c\u4efb\u52a1&ldquo;\u901a\u5411\u81ea\u7531&rdquo;\u8981\u6c42\u73a9\u5bb6\u5230\u8fbe\u540d\u4e3a&ldquo;Freedom Trail Ring&rdquo;\u7684\u91d1\u5c5e\u8868\u76d8\uff0c\u5e76\u4f7f\u7528\u8868\u76d8\u62fc\u5199\u7279\u5b9a\u5173\u952e\u8bcd\u624d\u80fd\u5f00\u95e8\u3002</p>\r\n\r\n<p>\u7ed9\u5b9a\u4e00\u4e2a\u5b57\u7b26\u4e32&nbsp;<strong>ring</strong>\uff0c\u8868\u793a\u523b\u5728\u5916\u73af\u4e0a\u7684\u7f16\u7801\uff1b\u7ed9\u5b9a\u53e6\u4e00\u4e2a\u5b57\u7b26\u4e32&nbsp;<strong>key</strong>\uff0c\u8868\u793a\u9700\u8981\u62fc\u5199\u7684\u5173\u952e\u8bcd\u3002\u60a8\u9700\u8981\u7b97\u51fa\u80fd\u591f\u62fc\u5199\u5173\u952e\u8bcd\u4e2d\u6240\u6709\u5b57\u7b26\u7684<strong>\u6700\u5c11</strong>\u6b65\u6570\u3002</p>\r\n\r\n<p>\u6700\u521d\uff0c<strong>ring&nbsp;</strong>\u7684\u7b2c\u4e00\u4e2a\u5b57\u7b26\u4e0e12:00\u65b9\u5411\u5bf9\u9f50\u3002\u60a8\u9700\u8981\u987a\u65f6\u9488\u6216\u9006\u65f6\u9488\u65cb\u8f6c ring \u4ee5\u4f7f&nbsp;<strong>key&nbsp;</strong>\u7684\u4e00\u4e2a\u5b57\u7b26\u5728 12:00 \u65b9\u5411\u5bf9\u9f50\uff0c\u7136\u540e\u6309\u4e0b\u4e2d\u5fc3\u6309\u94ae\uff0c\u4ee5\u6b64\u9010\u4e2a\u62fc\u5199\u5b8c&nbsp;<strong>key&nbsp;</strong>\u4e2d\u7684\u6240\u6709\u5b57\u7b26\u3002</p>\r\n\r\n<p>\u65cb\u8f6c&nbsp;<strong>ring&nbsp;</strong>\u62fc\u51fa key \u5b57\u7b26&nbsp;<strong>key[i]&nbsp;</strong>\u7684\u9636\u6bb5\u4e2d\uff1a</p>\r\n\r\n<ol>\r\n\t<li>\u60a8\u53ef\u4ee5\u5c06&nbsp;<strong>ring&nbsp;</strong>\u987a\u65f6\u9488\u6216\u9006\u65f6\u9488\u65cb\u8f6c<strong>\u4e00\u4e2a\u4f4d\u7f6e</strong>\uff0c\u8ba1\u4e3a1\u6b65\u3002\u65cb\u8f6c\u7684\u6700\u7ec8\u76ee\u7684\u662f\u5c06\u5b57\u7b26\u4e32&nbsp;<strong>ring&nbsp;</strong>\u7684\u4e00\u4e2a\u5b57\u7b26\u4e0e 12:00 \u65b9\u5411\u5bf9\u9f50\uff0c\u5e76\u4e14\u8fd9\u4e2a\u5b57\u7b26\u5fc5\u987b\u7b49\u4e8e\u5b57\u7b26&nbsp;<strong>key[i] \u3002</strong></li>\r\n\t<li>\u5982\u679c\u5b57\u7b26&nbsp;<strong>key[i]&nbsp;</strong>\u5df2\u7ecf\u5bf9\u9f50\u523012:00\u65b9\u5411\uff0c\u60a8\u9700\u8981\u6309\u4e0b\u4e2d\u5fc3\u6309\u94ae\u8fdb\u884c\u62fc\u5199\uff0c\u8fd9\u4e5f\u5c06\u7b97\u4f5c&nbsp;<strong>1 \u6b65</strong>\u3002\u6309\u5b8c\u4e4b\u540e\uff0c\u60a8\u53ef\u4ee5\u5f00\u59cb\u62fc\u5199&nbsp;<strong>key&nbsp;</strong>\u7684\u4e0b\u4e00\u4e2a\u5b57\u7b26\uff08\u4e0b\u4e00\u9636\u6bb5\uff09, \u76f4\u81f3\u5b8c\u6210\u6240\u6709\u62fc\u5199\u3002</li>\r\n</ol>\r\n\r\n<p><strong>\u793a\u4f8b\uff1a</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<center><img src="https://assets.leetcode-cn.com/aliyun-lc-upload/uploads/2018/10/22/ring.jpg" style="width: 26%;"></center>\r\n&nbsp;\r\n\r\n<pre><strong>\u8f93\u5165:</strong> ring = &quot;godding&quot;, key = &quot;gd&quot;\r\n<strong>\u8f93\u51fa:</strong> 4\r\n<strong>\u89e3\u91ca:</strong>\r\n \u5bf9\u4e8e key \u7684\u7b2c\u4e00\u4e2a\u5b57\u7b26 &#39;g&#39;\uff0c\u5df2\u7ecf\u5728\u6b63\u786e\u7684\u4f4d\u7f6e, \u6211\u4eec\u53ea\u9700\u89811\u6b65\u6765\u62fc\u5199\u8fd9\u4e2a\u5b57\u7b26\u3002 \r\n \u5bf9\u4e8e key \u7684\u7b2c\u4e8c\u4e2a\u5b57\u7b26 &#39;d&#39;\uff0c\u6211\u4eec\u9700\u8981\u9006\u65f6\u9488\u65cb\u8f6c ring &quot;godding&quot; 2\u6b65\u4f7f\u5b83\u53d8\u6210 &quot;ddinggo&quot;\u3002\r\n \u5f53\u7136, \u6211\u4eec\u8fd8\u9700\u89811\u6b65\u8fdb\u884c\u62fc\u5199\u3002\r\n \u56e0\u6b64\u6700\u7ec8\u7684\u8f93\u51fa\u662f 4\u3002\r\n</pre>\r\n\r\n<p><strong>\u63d0\u793a\uff1a</strong></p>\r\n\r\n<ol>\r\n\t<li><strong>ring</strong> \u548c&nbsp;<strong>key</strong>&nbsp;\u7684\u5b57\u7b26\u4e32\u957f\u5ea6\u53d6\u503c\u8303\u56f4\u5747\u4e3a&nbsp;1 \u81f3&nbsp;100\uff1b</li>\r\n\t<li>\u4e24\u4e2a\u5b57\u7b26\u4e32\u4e2d\u90fd\u53ea\u6709\u5c0f\u5199\u5b57\u7b26\uff0c\u5e76\u4e14\u5747\u53ef\u80fd\u5b58\u5728\u91cd\u590d\u5b57\u7b26\uff1b</li>\r\n\t<li>\u5b57\u7b26\u4e32&nbsp;<strong>key</strong>&nbsp;\u4e00\u5b9a\u53ef\u4ee5\u7531\u5b57\u7b26\u4e32 <strong>ring</strong>&nbsp;\u65cb\u8f6c\u62fc\u51fa\u3002</li>\r\n</ol>'}}}]);
